function crops_class(db_source){
    this.db = db_source;
}

function parseProductData(arr){
    var crops = new crops_class([])
	var products={};
	for(i = 0; i < arr.length; i++) {
		var the_product_obj = {};
		the_product_obj.type = arr[i].type;
		the_product_obj.month = arr[i].month;
		the_product_obj.crop = arr[i].crop;
        the_product_obj.variety = arr[i].variety;
        the_product_obj.county = arr[i].county;
        the_product_obj.town = arr[i].town;
		products[i] = the_product_obj;
    }
	crops.db = products;
    return crops;
}
