crops_class.prototype.print2console = function(){
    num_db = Object.keys(this.db).length;
    var index_product;
    for( index_product = 0; index_product < num_db; index_product++){
        if(this.db[index_product].variety==''){
            variety = '!無特定品種!';
        }else{
            variety = this.db[index_product].variety;
        }
        if(this.db[index_product].town == ''){
            town = '!無鄉鎮資料!';
        }else{
            town = this.db[index_product].town;
        }
        console.log("print: ["+index_product+"] ["+this.db[index_product].type+"]["+this.db[index_product].county+"]["+ town+"]["+this.db[index_product].crop+"]["+variety+"]["+this.db[index_product].month+"月]");
    }
}

crops_class.prototype.returnCropSpecificSeason = function(){
    num_db = Object.keys(this.db).length;
    var index_product;
    string_set = [];
    for( index_product = 0; index_product < num_db; index_product++){

        var product_variety;
        product_variety = this.db[index_product].variety;
		if(product_variety.length==0){var str_product_variety = '';}
		else {var str_product_variety = '['+product_variety+']';}
		product_month = this.db[index_product].month;
        //todo: empty variety and same crop in same season
        string_set = string_set + str_product_variety + '[' +product_month + '月]'+this.db[index_product].crop + '</br>';

      }
      return string_set
}
crops_class.prototype.filter_season = function(season){
    var filter_results = new crops_class([])
	//console.log("content:"+content+"\ncontent_type:"+content_type);
    var index_product=0;
	var filter_results_once = {};
	var num_results_once = 0;
	var num_to_filter = Object.keys(this.db).length;
  var season_1;
  var season_2;
  var season_3;
	for( index_product=0; index_product< num_to_filter; index_product++){
		var specific_data = this.db[index_product];
    switch(season){
      case MAP_SPRING:
        season_1 = 3;
        season_2 = 4;
        season_3 = 5;
      break;
      case MAP_SUMMER:
        season_1 = 6;
        season_2 = 7;
        season_3 = 8;
      break;
      case MAP_FALL:
        season_1 = 9;
        season_2 = 10;
        season_3 = 11;
      break;
      case MAP_WINTER:
        season_1 = 12;
        season_2 = 1;
        season_3 = 2;
      break;
    }
    if(this.db[index_product].month == season_1 | this.db[index_product].month == season_2 | this.db[index_product].month == season_3 ){
			filter_results_once[num_results_once] = this.db[index_product];
			num_results_once ++;
		}
	}
  filter_results.db = filter_results_once;
	return filter_results;
}
crops_class.prototype.list_town = function (){
	var num_to_filter = Object.keys(this.db).length;
	var list_crops = [];
	for( index_product=0; index_product< num_to_filter; index_product++){
		var specific_data = this.db[index_product];
		if(list_crops.indexOf(specific_data['town'])==-1){
			list_crops.push(specific_data['town']);
		}else{//do nothing
		}
	}
	return list_crops;

}
